import { Button } from '@mui/material'
import React from 'react'

const CustomButton = (props) => {
    return (
        <Button size="small" variant="contained" sx={{ height: 40, width: 130, borderRadius: 2, backgroundColor: '#2148C0' }} onClick={props.onClick}>
            {props.text}
        </Button>
    )
}

export default CustomButton
